import React from 'react';

class table extends React.Component {
    constructor(props){
        super(props);
        this.state = {
        }
    }
    campaigTable (campaigndta) {
        console.log("######### trong hàm cpTb")
        console.log(campaigndta)
        var data = campaigndta.map((n)=>{
            return <> 
                
                <tbody>
                    <tr>
                    <th>n.campaignName</th>
                    </tr>
                    <tr>
                    
                        <td>
                            <div>
                                <p>n.lineItemId</p>
                                <p>n.lineItemName</p>
                            </div>
                        </td>
                        <td>
                            <div className="round1">
                                <input type="checkbox" id="checkbox"/>
                                <label htmlFor="checkbox" />
                            </div>
                        </td>
                        <td>n.overallBudget</td>
                        <td>n.curentlyUsedAAmount</td>
                        <td>n.curentlyUsageRate</td>
                        <td>n.startDate</td>
                        <td>n.endDate</td>
                        <td><i className="fa fa-pencil-square-o" aria-hidden="true"></i></td>
                    </tr>
                    
                </tbody>
            
            </>
            }
            )
            
            return data;
    }
    render() { 
        console.log("##################")
        console.log(this.props.dt)
        var dta = this.props.dt
        var result = this.campaigTable(dta)
        return ( 
            <> 
            {result}
            </>
         );
    }
}
 
export default table;
